import React,{Component} from 'react';


const Rank =({ name, entries })=>{	
    return(
      <div > 
        <div className=' tc white f3'>
          {`${name}, your current entry count is...`}
        </div>
        <div className='tc white f1'>
          {entries}
        </div>


      </div>

      );
  
}
export default Rank;
